import React from "react";
import DateTimePicker from "react-widgets/lib/DateTimePicker";

const renderDateTimePicker = ({
  input: { onChange, value },
  showTime,
  label
}) => (
  <div>
    <label>{label}</label>
    <DateTimePicker
      onChange={onChange}
      format="DD MMM YYYY"
      time={showTime}
      value={!value ? null : new Date(value)}
    />
  </div>
);

export default renderDateTimePicker;
